from Tick4 import *
import matplotlib.pyplot as plt

width = 13
amountOfRuns = 13
allruns = [[] for _ in range(width * width)]


for compNum in range(width):
    for taxNum in range(width):
        print(compNum)
        for _ in range(amountOfRuns):
            allruns[taxNum + (width * compNum)].append(simulation(1 + (compNum / 100), taxNum / (width + 2)))
        print(allruns[taxNum + (width * compNum)])

# print(allruns)


def conNum(runDt):
    count = 0
    for run in runDt:
        if run[0] == -1:
            count += 1
    return count


def avNumOfRuns(runDt):
    numOfRuns = 0
    count = 0
    for run in runDt:
        if run[0] == -1:
            pass
        else:
            count += 1
            numOfRuns += run[0]
    return numOfRuns / count


def avConvergenceNum(runDt):
    avCon = 0
    for run in runDt:
        if run[0] != -1:
            avCon += 0.321  # Slight bump to account for stopping bias.
        else:
            avCon += run[1]
    return avCon / amountOfRuns


